import "../../homepage/style/homeStyle.scss";

const GroupForm = () => {
    

    return (
        <form>
            <div>
                <label>
                    Description:
                    <input type="text" />
                </label>
            </div>

            <div>
                <label>
                    Total Pay Amount:
                    <input
                        type="number"
                        value={amount}
                        onChange={(event) => setAmount(event.target.value)}
                    />
                </label>
            </div>

            <div>
                <label className="label">
                    Paid By:<button></button>and split<button></button>
                </label>
            </div>

            <button
                type="submit"
                className="button"
            >
                submit
            </button>
        </form>
    );
};

export default GroupForm;
